import "./App.css";
import Navbar from "./components/Navbar";
import Home from "./pages/Home";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Route>
        <Navbar />
        <Switch>
          <Route path='/' element={<Home/>} />
        </Switch>
      </Route>
    </div>
  );
}

export default App;
